<?phpnamespace DGIModule\Controller\Factories;use DGIModule\Controller\UserRegistrationController;use Zend\ServiceManager\FactoryInterface;use Zend\ServiceManager\ServiceLocatorInterface;class UserRegistrationControllerFactory implements FactoryInterface{    /**     * @param ServiceLocatorInterface $serviceLocator     * @return UserRegistrationController     */    public function createService(ServiceLocatorInterface $serviceLocator)    {        $sl = $serviceLocator->getServicelocator();        return new UserRegistrationController(            $sl->get('Config'),            $sl->get('doctrine.entitymanager.orm_default'),            $sl->get('MvcTranslator'),            $sl->get('Zend\Authentication\AuthenticationService'));    }	}